import React from "react";

const SliderPage = () => {
  return (
    <div className="my-5">
      <i className="font-weight-bold blue-text mr-2 mt-1" icon="thumbs-down" />
      <input type="range" className="custom-range" id="customRange1" />
      <i className="font-weight-bold blue-text mr-2 mt-1" icon="thumbs-up" />
    </div>
  );
}

export default SliderPage;
